import Button from "react-bootstrap/Button";
import Placeholder from "react-bootstrap/Placeholder";
import Form from "react-bootstrap/Form";
import React, { useState, useEffect } from "react";

// name email date id course
function Addstudent() {
  // function register()
  // {
  const [name, setname] = useState("");
  const [email, setemail] = useState("");

  const [amount, setfees] = useState("");

  const clickme = (e) => {
    // alert(name+phone);
    e.preventDefault();
    const d = new Date();
    let month = d.getMonth();
    const user = { username: name, email: email, month: month,amount:amount };
    console.log("hi" + user.username);
    console.log(user);

    fetch("http://localhost:3000/Addstudent", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        "Access-Control-Allow-Headers": "Content-Type",
        "Access-Control-Allow-Methods": "GET, POST, PUT, DELETE, OPTIONS",
        "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify(user),
    })
      .then((res) => res.json())
      .then((data) => {
        // window.location.replace("login.js");
        // alert(data);
        if(data!=0){
        alert("student added for registration");

        }
        else{
          alert("email already exists");

        }
        // alert("success");
      })
      .catch((err) => console.log(err));
  };

  // }

  return (
    <div>
      <div class="container-fluid pt-4 px-4 ">
        <div class="">
          <div class="">
            <div class="bg-secondary rounded h-100 p-4">
              <h6 class="mb-4">Student Registration</h6>
              <form onSubmit={clickme}>
                <div class="mb-3">
                  <label for="exampleInputEmail1" class="form-label">
                    Email Id{" "}
                  </label>
                  <input
                    onChange={(e) => setemail(e.target.value)}
                    type="email"
                    class="form-control"
                    id="exampleInputEmail1"
                    aria-describedby="emailHelp"
                  />
                  {/* <div id="emailHelp" class="form-text">We'll never share your email with anyone else.
                  </div> */}
                </div>
                <div class="mb-3">
                  <label for="exampleInputPassword1" class="form-label">
                    Name
                  </label>
                  <input
                    onChange={(e) => setname(e.target.value)}
                    type="text"
                    class="form-control"
                    id="exampleInputText1"
                  />
                </div>
                <div class="mb-3">
                  <label for="exampleInputPassword1" class="form-label">
                    Fees
                  </label>
                  <input
                    onChange={(e) => setfees(e.target.value)}
                    type="number"
                    class="form-control"
                    id="exampleInputText1"
                  />
                </div>
                <input class="checkbox-tools" type="radio" name="tools" id="tool-1" checked/>
						<label class="for-checkbox-tools" for="tool-1">
							<i class='uil uil-line-alt'></i>
							line
						</label>
						
                <div class="mb-3">
                  <label for="exampleInputPassword1" class="form-check">
                    Courses
                  </label>
                  <br />
                  <input
                    class="form-check-input"
                    type="checkbox"
                    value=""
                    id="flexCheckIndeterminate"
                  />
                  <label class="form-check-label" for="flexCheckIndeterminate">
                    JAVASCRIPT
                  </label>
                  <br />

                  <input
                    class="form-check-input"
                    type="checkbox"
                    value=""
                    id="flexCheckIndeterminate"
                  />
                  <label class="form-check-label" for="flexCheckIndeterminate">
                    PHP
                  </label>
                  <br />
                  <input
                    class="form-check-input"
                    type="checkbox"
                    value=""
                    id="flexCheckIndeterminate"
                  />
                  <label class="form-check-label" for="flexCheckIndeterminate">
                    C++
                  </label>
                  <br></br>
                  <input
                    class="form-check-input"
                    type="checkbox"
                    value=""
                    id="flexCheckIndeterminate"
                  />
                  <label class="form-check-label" for="flexCheckIndeterminate">
                    PYTHON
                  </label>
                </div>
                <button type="submit" class="btn btn-primary">
                  Sign in
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Addstudent;
